import React from "react";

//import database
import { media_list } from "../data/media_list";

const Home = () => {
  return (
    <div>
      {media_list.map((item, key) => {
        return (
          <ul key={key}>
            <li> {key + 1}. <a href={item.link}> {item.link} </a></li>
          </ul>
        );})}
    </div>
  );
};

export default Home;
